import React from 'react'
import { Hero } from '../Hero';
import './Evets.cs'

function Events() {
  return (
    <>
        <Hero MainTextOut="Upcoming" MainTextOth="Events" MainTextSize="100px"/>
        <h3 className="year">2023</h3>
    </>
  );
}

export default Events
